import React from 'react';

const User = props => {
    const usersData = props.items;
    const artistData = usersData.map((artist) =>
    <div>

        <h3>{artist.name}</h3>
        <img src={artist.images[0]} alt="artist"/>
    </div>
    ) 
    return (
        <div>
            {artistData}
        </div>
    )
}
export default User;
